@-moz-document url("https://www.roblox.com/home") {
/* Made by SavageDom*/ 

  

  .ad,.ad *,.img_ad,.ad-annotations,#google_image_div,#aw0,#AdvertisingLeaderboard 

  { 

    display: none !important; 

  } 

  

  .ad,.ad *,.img_ad,.ad-annotations,#google_image_div,#aw0,#AdvertisingLeaderboard 

  { 

    display: none !important; 

  } 

  

  #header 

  { 

    background-color: #000320; 

  } 

  

